pragma solidity ^0.5.9;
pragma experimental ABIEncoderV2;

import "../lib/Controller.sol";
import "../lib/ERC20Detailed.sol";
import "../CToken.sol";
import "../interface/PriceOracle.sol";
import "../interface/IMdexPair.sol";
import "../lib/SafeMath.sol";
import "../lib/NativeAddressLib.sol";


contract MdexPrice is Controller, PriceOracle {

    using SafeMath for uint256;

    uint public constant BASE_DECIMAL = 1e18;
    address public usdt;
    address public wht;


    mapping(address => address) public underlyingExchange;

    mapping(address => bool) public swapLps;

    constructor(address _usdt, address _wht)  Controller() public {
        usdt = _usdt;
        wht = _wht;
    }

    function getUnderlyingPrice(CToken cToken) external view returns (uint){
        address _underlying = cToken.underlying();
        if (swapLps[_underlying]) {
            return calLpPrice(_underlying);
        }
        if (_underlying == NativeAddressLib.nativeAddress()) {
            _underlying = wht;
        }
        return getPrice(_underlying);
    }

    function getPrice(address _address) public view returns (uint){
        if (_address == usdt) {
            return BASE_DECIMAL;
        }
        return IMdexPair(underlyingExchange[_address]).price(_address, BASE_DECIMAL);
    }


    function setUnderlyingExchange(address underlying, address exchange) onlyController external {
        underlyingExchange[underlying] = exchange;
    }


    function addSwapLp(address _pairaddress) onlyController external {
        swapLps[_pairaddress] = true;

    }

    function calLpPrice(address _pairAddress) public view returns (uint){

        address token0 = IMdexPair(_pairAddress).token0();
        address token1 = IMdexPair(_pairAddress).token1();

        uint _totalSupply = IMdexPair(_pairAddress).totalSupply().div(10 ** uint(IMdexPair(_pairAddress).decimals()));

        uint _totalToken0 = ERC20Detailed(token0).balanceOf(_pairAddress);

        uint _totalToken1 = ERC20Detailed(token1).balanceOf(_pairAddress);

        uint _token0Decimal = ERC20Detailed(token0).decimals();
        uint _token1Decimal = ERC20Detailed(token1).decimals();


        uint _token0Price = getPrice(token0);

        uint _lpPerToken0 =
        (_totalToken0.mul(_token0Price)).div(_totalSupply.mul(10 ** _token0Decimal));


        uint _token1Price = getPrice(token1);

        uint _lpPerToken1 = (_totalToken1.mul(_token1Price)).div(_totalSupply.mul(10 ** _token1Decimal));

        return _lpPerToken0.add(_lpPerToken1);

    }


}
